reviewBody:
원장님이 친절하시고 편안하게 치료했습니다. 
다니던 치과가 너무 불친절하고 설명을 제대로 해주지안호 치료들이 이루어져서 병원을 옮겼는데 과하게 진료를 늘리지도않고 친절하게 대해주셔서 좋았습니다. 
다만, 발렛비가 별도로 발생하는 부분만 좀 그랬어요~^^;;

